INSERT INTO `cars` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(132, '2003–2006 Chevrolet SSR', 'Just as the Thunderbird was a softer take on the 1950s T-Bird, the SSR was an oddly proportioned remake of a 1950s Chevy pickup truck. It was supposed to deliver one part truck, one part muscle car, and one part open-air convertible. The trouble was the SSR (Super Sport Roadster) was not a good representation of any of these genres. It used a Chevy Trailblazer SUV chassis instead of one meant for a car or a pickup truck—so it offered no real hauling capacity. Worse, that chassis just wasnt sporty. The SSR folding hardtop was prone to wind noise, and the hard tonneau cover over the bed often leaked. The cabin was very tight, with little space for anything except the two passengers, and not even a single cup holder to be found. Under the hood was the same 300-hp 5.3-liter V-8 that came in the Trailblazer. But with nearly 4800 pounds of curb weight, the early SSRs were not particularly quick. ', , 10, 1);
INSERT INTO `cars` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(133, '1997–2002 Plymouth/Chrysler Prowler', ' To inject a little excitement into the long-suffering Plymouth brand, Chrysler developed a rather radical retro hot rod for 1997. The Prowler was one of the first retro cars of this era, and the last new Plymouth before the brand died. In that first year, only a handful were built. Every one of them was purple, equipped with a pokey 215-hp 3.5-liter V-6 from Chryslers front-drive family sedans. After skipping a production year, the 1999 Prowler arrived with more colors and a 38-hp boost in oomph.\r\nIt just wasnt enough. Here was a great-looking, concept-car-come-to-life hot rod that had no V-8 engine beneath its fenders and no manual transmission either. What good is a hot rod that cant light up the tires into a white haze of burned rubber? The Prowler was still somewhat fun to drive just because of its radical looks, but the suspension was so rough you wouldnt be having fun for long—especially after your morning coffee resting in the cup holder had spilled on your pants after a mild pothole. And trunk space was so limited that Chrysler actually offered a $5000 trailer option to haul your gear. Weird.\r\n\r\n', , 11, 1);
INSERT INTO `cars` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(134, '2002–2005 Ford Thunderbird', 'After a five-year absence, the legendary Ford Thunderbird nameplate returned for 2002 as a rounded tribute to the original T-Birds of the 1950s. It certainly appealed to an older crowd that appreciated the look, but younger buyers werent into the styling that resembled a used soap bar.\r\nUnder the skin, the Bird had promise. It rode on the same rear-drive chassis as the Lincoln LS and Jaguar S-Type (Jaguar was owned by Ford at the time) and used a version of the Jag V-8, making 252 hp paired to a five-speed automatic. That sounds like a recipe for a relatively exciting car. But instead of firming the chassis for fun back-road driving, Ford tuned it for a relaxing ride. This was a real Palm Beach cruiser—especially when painted in one of several retro pastel hues. Unfortunately, it was not the hot seller Ford had hoped for.\r\n ', , 12, 1);
INSERT INTO `cars` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(135, '2004–2008 Chrysler Crossfire', ' The Chrysler Crossfire concept that debuted in 2001 was a cool retro sports car that aped just enough from the Audi TT and blended it with historic Chrysler designs and an Art Deco aesthetic. But here was a concept that did not elegantly make the leap from show floor to showroom. Instead, the Chrysler Crossfire became a poster car for the misguided and mismanaged marriage between Daimler (Mercedes-Benz) and Chrysler in the late 1990s.\r\nThe company wanted customers to believe that DaimlerChrysler brought together the best of American and German engineering and design into its cars. The idea for the Crossfire, company executives proclaimed in a lavish auto show unveiling, was to show  where Route 66 meets the Autobahn. But, in truth, the Crossfire concepts elegant proportions and design were adapted and shrink-wrapped to fit onto a retired version of the Mercedes-Benz SLKs chassis. It looked awkward, and it was cramped inside. Performance was respectable, especially the rare SRT-6 model—a mechanical copy of the Mercedes-Benz SLK 32 AMG. But the ride was rough, especially on that model, and sales were slow. Today the weird Crossfire is generally unloved by both American and German car fans.\r\n', , 15, 1);

